import React from "react";
import ListItem from "./ListItem";

function List(){
     return(
        <ul className="list-group">

           <ListItem type="Dine in" id="Dine in" img='https://images.unsplash.com/photo-1528696353932-be229661fd48?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=80&q=60' />
           <ListItem type="Delivery" id="Delivery" img='https://picsum.photos/61'/>
        </ul>
     ); 
     

}
export default List
